export default class KillSwitches {
    /**
     * Killswitch to safeguard a change which enables customized deep cloning of the web part
     * properties during serialization of the web part, which now contains dynamicProperties.
     */
    static isPropertiesCloningUsingDeepCloneWithKillSwitchActivated(): boolean;
    /**
     * Killswitch to safeguard a change which decides which properties to persist based on the
     * disableReactivePropertyChanges flag.
     */
    static isPersistedPropertiesUsingDisableReactivePropertyChangesKillSwitchActivated(): boolean;
    /**
     * Killswitch for timing out viewport loading and collecting QOS information.
     */
    static isViewportLoadTimeoutKillSwitchActivated(): boolean;
    static isPropertyPaneFocusKillSwitchActivated(): boolean;
    /**
     * Killswitch for adding conditional groups.
     */
    static isPropertyPaneConditionalGroupKillSwitchActivated(): boolean;
    /**
     * Killswitch for adding an option to hide group name in group rendering.
     */
    static isHideGroupNameOptionKillSwitchActivated(): boolean;
    static isCheckManifestRequestKillSwitchActivated(): boolean;
    static isRejectLoadWebPartPromiseProperlyKillSwitchActivated(): boolean;
    /**
     * Killswitch for checking whether all web parts are rendered.
     */
    static isCheckingAllWebPartsRenderedKillSwitchActivated(): boolean;
    static isRemoveHiddenElementFocusA11yKillSwitchActivated(): boolean;
}
